import { CHANGE_SCHEMA, ADD_PAGECHILDREN } from './constant';

export const getChangeSchemaAction = (schema) => {
    return {
        type: CHANGE_SCHEMA,
        value: schema
    }
};

export const getAddPagechildrenAction = (child) => {
    return {
        type: ADD_PAGECHILDREN,
        value: child
    }
}
